import {useEffect, useState} from 'react'
import axios from 'axios';
import YouTube from 'react-youtube';
function App() {
  const [songs, setsongs] = useState([])
  useEffect(() => {
     axios({
      url: 'https://www.googleapis.com/youtube/v3/playlistItems?part=snippet%2CcontentDetails&maxResults=9&playlistId=PLcjXjwgJpOzZoOYXz8y3I2PE_HspGkUry&key=AIzaSyA43Saqt5kUkQwm-BV_tWWwgA8HP5bwbXE',
      method: 'get'
    }).then(response => setsongs(response.data.items));
    //console.log(songs);
  }, [])
  const opts = {
    height: '390',
    width: '640',
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 1,
    },
  };

  return (
    <div>
      {songs.map(item => <div key  = {item.id}>{<YouTube videoId={songs[0].contentDetails.videoId} opts={opts} />}</div>)}
    </div>
  );
}

export default App;
